	('Java高级开发工程师', '武汉金豆医疗数据科技有限公司', '1-1.5万/月', 10000, 15000, '武汉', '06-19', 'https://jobs.51job.com/wuhan/103492042.html?s=01&t=0', '职位描述：\n1、负责产品/项目\n2、负责整理基础构件和业务构件，进行产品化改造及核心代码的编写，并具备解决高并发、高稳定性、业务模型复杂等带来的各种挑战及技术难关；\n3、参与项目的系统设计和核心代码开发，指导和培训其他工程师；\n\n岗位要求:\n1、5年以上Java开发经验，2年以上互联网公司架构设计经验；\n2、具有扎实的Java基础，熟悉Java技术体系，熟悉IO、多线程、集合等基础框架，熟悉分布式、缓存、消息、搜索等机制；\n3、精通Java编程，能够熟练应用springmvc、spring、mybatis等主流开发框架；\n4、精通设计模式，熟悉服务化方案设计、开发实施的实际经验，要具备实际的服务规划、服务粒度划分经验；\n5、对数据库的基本理论和内部实现机制有深刻的理解，能够熟练应用MySQL /NoSQL，有实际大数据量的数据库设计经验；\n6、熟悉缓存技术、服务器性能调优、集群技术处理、负载均衡、异地多活等大访问高并发架构设计，有docker容器云架构经验尤佳；\n7、知识面广，思路开阔，创新能力强，对新技术持有敏感性并愿意致力于新技术的探索和研究。\n\n\n\n\n分享\n\n\n微信\n邮件'),
	('Java开发工程师', '宁波易简电子科技有限公司', '6-8千/月', 6000, 8000, '异地招聘', '06-19', 'https://jobs.51job.com/ningbo/101561265.html?s=01&t=0', '1、实际JAVA软件开发工作2年以上，均可\n2、计算机相关专业优先，本科以上优先。\n3、为人踏实，武汉及周边省市籍贯优先。\n,\n工作时间：\n8:30-17:30，双休，偶尔加班。\n其他方面：\n要求工作稳定，不要经常跳槽的。\n\n\n\n分享\n\n\n微信\n邮件'),
	('java开发工程师', '中铁工程机械研究设计院有限公司', '5-9千/月', 5000, 9000, '武汉-洪山区', '06-19', 'https://jobs.51job.com/wuhan-hsq/103532428.html?s=01&t=0', 'Java开发工程师\n岗位职责\n1、负责公司已有项目及产品的维护、优化；\n2、对新项目参与需求调研、业务分析、系统设计、梳理数据对接逻辑流程、设计API结构及编码等工作；\n3、能独立完成软件相应模块开发、测试、及产品的部署工作，并编制完善各类开发文档；\n4、善于学习新技术、解决技术难题，整理相关技术文件并编制完善各类开发文档；\n\n任职要求：\n1、本科及以上学历，985、211大学计算机或相关专业者优先(特别优秀或经验丰富者不限)；\n2、三年或以上java Web系统开发经验，熟悉Web前端技术，熟练Jsp、servlet、JavaBean的使用, 熟悉JavaScript、Html、xml、css、JQuery、ajax等开发技术；\n3、熟悉java基础(对IO、多线程、并发控制、事务控制、异常处理等有深刻的认识)；精通JAVA编程：J2EE规范下的JSP，Servlet，JDBC，JavaBeans等编程；\n4、熟悉Spring,spring MVC/struts, mybatis/hibernate等主流开源框架；\n5、熟悉maven、SVN/Git等项目构建或管理工具；熟练掌握mvc架构、IOC、AOP等编程思想；\n6、熟悉Sql server、mysql、oracle等RDBMS中至少一种数据库，熟练使用sql语言，了解至少一种Nosql；\n7、熟悉Tomcat、Ngnix、Apache Http等主流应用服务器的使用与配置管理；\n8、熟悉接口服务框架webservice、socket、restful、http、https等技术，了解微服务架构理念、实现技术，有Spring Cloud开发经验者优先；\n9、拥有和工作年限相称的广度和（或）深度，有较强的逻辑思维能力，善于分析、归纳、描述、沟通和解决问题；\n10、具备良好分析解决问题能力，能独立承担任务并有很好地把控进度的能力,责任心强，主动好学,有很好的沟通和团队协作能力；\n\n我们的优势：\n1、国有企业，正规五险一金；\n2、8小时工作制，每周双休，国家法定节假日正常休息。\n3、关注员工业余生活，经常有各项体育活动及比赛；\n4、公司办公环境和谐舒适，二环线内交通便利，欢迎有才之士登门！\n\n\n\n\n\n分享\n\n\n微信\n邮件');
