	('JAVA讲师', '武汉一代人教育科技有限公司', '1-1.5万/月', 10000, 15000, '武汉', '06-15', 'https://jobs.51job.com/wuhan/75758608.html?s=01&t=0', '工作职责：\n1、负责按照产品规\n2、负责所带班级的学员管理；\n3、负责按照标准化要求提升授课能力；\n4、积极配合其它部门的工作或学校安排的大型活动。\n\n任职条件：\n1、计算机及相关专业，大专及以上学历；\n2、2年以上软件开发工作或项目经验；\n3、有较强的团队意识，语言沟通表达流利，工作耐心、细致，责任心强；\n4、有IT类课程教学培训经验者优先。\n\n技术条件：\nJAVA方向技术要求：\n1、精通JAVA开发，熟悉JSP/Servlet/JavaBean/JavaScript/Struts/Spring/Hibernate/EJB/Ajax等开发技术；\n2、熟悉Oracle/SQL Server 等主流数据库开发技术。\n\n\n工作地点：武汉武昌区中南路中南大厦，***不考虑。\n应聘者一经录用，签订劳动合同，缴纳五险，同时享有带薪培训，带薪年休假等一系列相关福利。\n\n面试地址：\n武汉武昌区中南路80号中南大厦1门4楼（注：地铁洪山广场站B3出口前行300米左右）\n\n工作地址：（可根据个人住址就近安排）\n1、武昌区中南路80号中南大厦1门4楼（注：地铁洪山广场站B3出口前行300米左右）\n2、武汉市洪山区八一路延长线旁东湖东路（附近公交站：八一路沙湾村站，可乘坐413、402、340路公交到达）\n\n职能类别： 软件工程师 讲师 高级讲师\n关键字： 软件开发 JAVA\n\n收入=高底薪+课时费+带班奖金+年终奖金，综合年收入10-20万。\n\n基本福利：\n1、缴纳社保五险；\n2、带薪病假、婚假、产假、陪产假、哺乳假、丧假；\n3、节日礼物\n4、年度拓展或旅游\n5、年度先进表彰\n6、按国家法定节假日休假\n7、带薪寒假\n\n\n学习发展：\n1、新员工入职培训，让新员工较好度过磨合期，并建立学校归属感和对企业文化的良好的认知和认同。\n2、管理岗位及核心岗位的提升培训，让管理岗位及核心岗位员工的综合素质、管理能力等得到提升，为各级管理岗位提供人才储备。\n3、市场类岗位的销售技巧培训，让市场类岗位的销售技巧和服务水平得到提升，为市场扩展提供保障。\n\n联系我们 ：\n电话：027-87264668\n联系人：王老师\n\n\n\n分享\n\n\n微信\n邮件'),
