	('Android研发工程师', '上海中地数码科技有限公司', '0.5-1.2万/月', 5000, 12000, '武汉', '07-20', 'https://jobs.51job.com/wuhan/102035414.html?s=01&t=0', '岗位职责：\n1、基于Andro\n2、Android手机、平板终端软件的产品开发与维护；\n3、能独立完成客户端软件需求的整理和软件的设计；\n4、能按照项目计划，按时提交高质量的代码，完成开发任务；\n5、规范和文档的编写、维护；\n6、手机软件开发技术方面的评估以及可行性方面的分析和探索；\n7、其他与项目有关的工作。\n岗位要求：\n1、1年以上Android开发经验；大专，熟悉Android内部和底层的框架结构，能够熟练使用Android SDK；熟悉Android平台UI设计及常用布局。\n2、开发基础良好，有扎实的Java/C++语言基础；对手机软件性能优化、内存优化有一定了解；\n3、有ArcGIS地图、百度谷歌地图开发经验者优先；\n4、有Android Market线上作品者及Symbian或IOS开发经验者优先；\n5、具有面向对象的编程思想，了解一定的设计模式，具备一定的框架设计能力；\n6、有挑战精神，能够承担压力，具有独立完成模块开发的能力；\n7、有良好的沟通能力和团队合作精神，可进行需求调研和项目实施工作；\n\n\n\n\n分享\n\n\n微信\n邮件'),
	('软件开发工程师', '武汉亚心医院', '0.8-1万/月', 8000, 10000, '武汉-汉阳区', '07-20', 'https://jobs.51job.com/wuhan-hyq/97371543.html?s=01&t=0', '&\n\n&\n\n1.负责后端服务的设计、开发、单元测试，编写相关开发文档；\n2.有效分析并解决开发过程中的问题，参与技术难题攻关，重构系统，确保系统质量及稳定性；\n3.负责Code Review的任务，确保相关代码的有效性和正确性，并能够提供相关性能以及安全的建议；\n4.跟踪技术发展趋势，组织研究和培训，提升团队整体技术水平及效率；\n5.参与相关设计和技术评审，并提出个人见解。\n&\n\n1.计算机及其相关专业本科以上学历；\n2.精通Java开发，有三年以上Java开发经验和一定管理能力；\n3.熟悉Spring Cloud、MyBatis（Hibernate），并有实际开发经验；\n4.熟悉主流关系型数据库开发，如Oracle或MySQL；\n5.熟悉Maven/JIRA/Jenkins项目配置管理工具；\n6.熟悉Redis、Memcached缓存，Windows和Linux服务器；\n7.熟悉JS，JQuery，CSS，H5等前端开发技术，有vue.js开发经验优先，熟练使用Visio、PD等设计工具；\n有医疗行业经验或大型分布式系统开发经验者优先。\n&\n\n\n1.参与项目的设计和开发工作；\n2.协助完成需求采集、需求分析以及相关设计工作；\n3.按期完成上级安排的任务，确保代码调试通过，逻辑正确；\n4.指导初级开发人员,负责对下属程序员的代码质量规范检查及技术指导工作；\n5.负责代码走读，保证代码质量。\n\n1.本科及以上学历，计算机相关专业；\n2.2年以上JAVA WEB开发经验；\n3.具备扎实的Java基础，精通Java EE,SOA,OSGI等相关技术；\n4.熟练掌握Spring，ibatis，Spring，redis等主流JavaEE开源框架；\n5.熟悉主流关系型数据库开发，如Oracle或MySQL；\n\n&\n\n\n\n\n\n分享\n\n\n微信\n邮件'),
	('实施工程师', '武汉优信众网科技有限公司', '6-8千/月', 6000, 8000, '武汉-洪山区', '07-20', 'https://jobs.51job.com/wuhan-hsq/104546332.html?s=01&t=0', '1、负责公司运维项目的系统升级、日常\n2、根据项目需求, 项目IT产品的安装,调试、软件实施服务；\n3、处理客户的服务请求，反馈客户要求与研发协调工作；\n4、负责公司产品的安装调试、演示培训、应用指导等实施上线工作；\n5、解决客户提出的有关系统使用的疑难问题；\n6、解决系统使用中客户碰到的问题，维护客户关系，提高客户满意度；\n7、负责公司网络，电脑周边硬件设备日常维护，电脑设备故障排除等；\n任职要求：\n1、计算机专业，有Java基础工作经验者优先；\n2、精通计算机软硬件维护，熟悉TCP/IP、VPN，熟悉交换机及路由器设置；\n3、具有较强的网络安全意识，了解安全系统的结构与实施，有网络故障的定位排错能力；\n4、具有良好的沟通能力和理解能力，有较强的客户服务意识，能够高效的解决用户的问题；\n5、善于学习新技能、责任心强、诚实敬业，做事耐心细致、稳定、踏实；\n\n\n\n分享\n\n\n微信\n邮件'),
	('PHP程序员 / Magento开发工程师', '深圳市泰兴星科技有限公司', '6-8千/月', 6000, 8000, '武汉-洪山区', '07-19', 'https://jobs.51job.com/wuhan-hsq/98882944.html?s=01&t=0', '1、 计算机或相关专业大专及以上学历；\n2、 熟悉Apache+php+mysql的配置及管理；熟悉PHP/MySQL开发；\n3、 熟悉Magento、Joomla等系统,及各类服务器软件配置者优先；\n4、 有 Magento/zen cart/oscommerce 等二次开发经验者优先考虑；\n5、 理解DIV+CSS、JavaScript以及Ajax等技术；\n6、 强烈的责任心和较强的学习能力，能够承受较大的工作压力。\n\n\n\n工作职责：\n1.负责公司网站整体规划、功能设计、程序开发工作；\n2.负责协调与公司其他部门的工作，在技术上帮助实现SEO优化的需求\n\n3.负责公司各网站开发与测试，维护已有程序的升级和错误更正;\n4.负责项目开发，开发设计网站新功能，日常后台、服务器等维护，\n协同完成网 站升级工作.\n\n\n\n\n分享\n\n\n微信\n邮件'),
	('赴日本软件工程师', '北京核心软件有限公司', '1.5-4万/月', 15000, 40000, '异地招聘', '07-19', 'https://jobs.51job.com/overseas/101940222.html?s=01&t=0', '1）工作地点在日本，东京、大阪、名古屋等地\n2）按设计书开发软件\n3）具有良好的团队协作和沟通能力\n\n要求：\n1）计算机相关专业毕业，大专以上学历\n2）日语二级以上\n3）熟练掌握一种以上开发语言（JAVA或.net或C、C++）\n4）3年以上软件开发经验\n\n\n\n\n分享\n\n\n微信\n邮件'),
	('软件开发项目经理', '武汉飞沃科技有限公司', '6-8千/月', 6000, 8000, '异地招聘', '07-19', 'https://jobs.51job.com/hangzhou-yhq/97910982.html?s=01&t=0', '1、年龄要求：\n2、学历要求：本科及以上\n3、专业要求：计算机、电子信息工程、通信工程、应用数学、应用物理、自动控制、自动化等\n4、经验要求：\n\n技能要求：\n1、熟悉linux、C/C++、python、java等；\n2、熟悉TCP/IP协议、socket编程；\n3、具有面向对象分析、设计、开发能力，精通主流应用服务器的架构体系、数据库以及各种开源中间件技术；\n4、有优秀的学习能力，能快速的掌握各种新知识，并能积极的分享知识带动团队成长；\n5、具备良好的文档撰写能力、编写习惯，良好的抽象思维和逻辑思维能力，独立分析问题解决问题的能力；\n岗位职责：\n1、根据项目需求撰写系统方案设计，参与软件架构和软件方案设计，负责核心代码设计；\n2、解决项目中关键问题和技术难题；\n3、参与新项目预研、新技术攻关；\n4、指导初级工程师进行系统开发，并确保开发规范执行；\n5、制定并参与产品调试、测试流程，严格控制产品质量，对产品性能和质量负责；\n6、制定并参与产品规范化技术文档和项目阶段性评审依据，并提供技术支持；\n7、负责技术上相互协作、相互配合；\n8、负责对产品完善及升级换代；\n9、制定、整理并规范化技术过程文档归档管理（主要包括设计方案、代码管理、用户手册等）\n10、负责与设计相关的技术储备，积极推动技术创新；\n11、负责软件部门人才招聘、培养与储备；\n\n\n\n分享\n\n\n微信\n邮件');
