INSERT INTO `sys_dao_t` (`module`, `demension`, `action`, `value`, `json_data`) VALUES
	('gridSchema', NULL, 'strs', 'SELECT json_data\r\nFROM sys_lookupitem_t\r\nwhere type_id=\'grid\'\r\n	and id=\'${gid}\'', NULL),
	('lookup', NULL, 'ra', 'SELECT id,\r\n	en,\r\n	cn,\r\n	value,\r\n	detail,\r\n	attr1,\r\n	attr2,\r\n	attr3,\r\n	attr4,\r\n	attr5,\r\n	attr6\r\nFROM Lookup_t\r\nwhere type_id=${typeId}', NULL),
	('lookupType', NULL, 'ra', 'select id,\r\n	cn,\r\n	en,\r\n	detail\r\nfrom sys_lookuptype_t', NULL),
	('menu', NULL, 'ra', 'SELECT id as "id",\r\n    parent_id as "parentId",\r\n    parent_id as "pid",\r\n    cn as "cn",\r\n    en as "en",\r\n    cn as "text",\r\n    index_id as "indexId",\r\n    url as "url",\r\n    detail as "detail"\r\nFROM sys_Menu_t\r\nwhere is_active=\'Y\'', NULL),
	('menuTree', NULL, 'querys', 'SELECT id as "id",\r\n    parent_id as "parentId",\r\n    parent_id as "pid",\r\n    cn as "cn",\r\n    en as "en",\r\n    cn as "text",\r\n    index_id as "indexId",\r\n    url as "url",\r\n    detail as "detail"\r\nFROM sys_Menu_t\r\nwhere\r\n<#if id?? && id!=\'\'>\r\n    parent_id =\'${id}\'\r\n<#else>\r\n    parent_id is null or parent_id=\'\'\r\n</#if>\r\n	and is_active=\'Y\'\r\norder by index_id', NULL),
	('permission', NULL, 'ra', 'select concat(module,\'.\',action) as "permission"\r\nfrom sys_role_permission_t\r\nwhere role_id=${role}\r\n', NULL),
	('role', NULL, 'ra', 'select id,\r\n	name_cn,\r\n	name_en,\r\n	detail\r\nfrom sys_role_t', NULL),
	('todo', NULL, 'ra', 'select *\r\nfrom todo_t\r\n<#if userId?? && userId!=\'\'>\r\nwhere user_id=${userId}\r\n</#if>', NULL),
	('user', NULL, 'r', 'select * from user_base_t where id=${id}', NULL),
	('user', NULL, 'ra', 'select * from user_base_t', NULL),
	('userRole', NULL, 'ra', 'select user_id,\r\n	role_id,\r\n	start_date,\r\n	end_date\r\nfrom sys_user_role_t', NULL),
	('io', 'year', 'ra', 'select * \r\nfrom io_year_v\r\norder by year', '[{\r\n	"col":"year",\r\n	"name":"年份"\r\n},{\r\n	"col":"demand",\r\n	"name":"需求"\r\n},{\r\n	"col":"supply",\r\n	"name":"供应"\r\n},{\r\n	"col":"gap",\r\n	"name":"缺口"\r\n},{\r\n	"col":"gaps",\r\n	"name":"累计缺口"\r\n}]'),
	('io', 'month', 'ra', 'select * \r\nfrom io_month_v\r\norder by month', NULL),
	('51job', NULL, 'us', 'insert into job_t(job,company,location,salary,salary_start,salary_end,create_date,url,detail)\r\nvalues\r\n<#list list as vo>\r\n	<#if vo_index gt 0>\r\n	,\r\n	</#if>\r\n	(\'${vo.job}\',\'${vo.company}\',\'${vo.location}\',\'${vo.salary}\',${vo.salaryStart?c},${vo.salaryEnd?c},\'${vo.createDate}\',\'${vo.url}\',\'${vo.detail}\')\r\n</#list>	', NULL),
	('51job', NULL, 'truncate', 'truncate table job_t', NULL),
	('51Job', NULL, 'ra', 'select company as "company",\r\n	job as "job",\r\n	location as "location",\r\n	salary_start as "salaryStart",\r\n	salary_end as "salaryEnd",\r\n	detail as "detail"\r\nfrom job_t\r\nwhere salary_end<100000', NULL),
	('51Job', 'company', 'ra', 'select company as "company",\r\n	avg((salary_start+salary_end)/2) as "salaryAvg",\r\n	max(salary_end) as "salaryMax"\r\nfrom job_t\r\nwhere salary_end<100000\r\n	and salary_end>=20000\r\ngroup by company\r\norder by salaryMax asc,avg((salary_start+salary_end)/2) asc', NULL),
	('51Job', 'skillHeat$max', 'ra', 'select t2.category as "category",\r\n	t1.text as "text",\r\n	t1.c as "c",\r\n	t1.salary_start as "salaryStart",\r\n	t1.salary_end as "salaryEnd",\r\n	t1.salary_avg as "salaryAvg"\r\nfrom job_skill_heat_t t1\r\nleft join dictionary_t t2\r\n	on t1.text=t2.text\r\norder by t1.salary_end,t1.salary_start', NULL),
	('health', 'weight', 'ra', 'select log_date as "logDate",\r\n	value as "value",\r\n	bmi as "bmi"\r\nfrom health_weight_v\r\norder by log_date', NULL),
	('51Job', 'skillHeat$truncate', 'u', 'delete from  job_skill_heat_t where 1=1', NULL),
	('51job', 'skill$dictCount', 'u', 'insert into job_skill_heat_t(text,c,salary_start,salary_end,salary_avg)\r\nvalues\r\n<#list list as vo>\r\n	<#if vo_index gt 0>\r\n	,\r\n	</#if>\r\n	(\'${vo.text}\',${vo.c?c},${vo.salaryStart?c},${vo.salaryEnd?c},${vo.salaryAvg?c})\r\n</#list>	', NULL),
	('51job', 'detail', 'strs', 'select detail from job_t', NULL),
	('51job', 'skill$dictionary', 'strs', 'select text from dictionary_t', NULL),
	('51Job', 'skillHeat$min', 'ra', 'select t2.category as "category",\r\n	t1.text as "text",\r\n	t1.c as "c",\r\n	t1.salary_start as "salaryStart",\r\n	t1.salary_end as "salaryEnd",\r\n	t1.salary_avg as "salaryAvg"\r\nfrom job_skill_heat_t t1\r\nleft join dictionary_t t2\r\n	on t1.text=t2.text\r\norder by t1.salary_start,t1.salary_end\r\nlimit 1,20', NULL),
	('51Job', 'skillHeat$avg', 'ra', 'select t2.category as "category",\r\n	t1.text as "text",\r\n	t1.c as "c",\r\n	t1.salary_start as "salaryStart",\r\n	t1.salary_end as "salaryEnd",\r\n	t1.salary_avg as "salaryAvg"\r\nfrom job_skill_heat_t t1\r\nleft join dictionary_t t2\r\n	on t1.text=t2.text\r\norder by "salaryAvg",t1.salary_end\r\nlimit 1,20', NULL),
	('51Job', 'skillHeat', 'ra', 'select t2.category as "category",\r\n	t1.text as "text",\r\n	t1.c as "c",\r\n	t1.salary_start as "salaryStart",\r\n	t1.salary_end as "salaryEnd",\r\n	t1.salary_avg as "salaryAvg"\r\nfrom job_skill_heat_t t1\r\nleft join dictionary_t t2\r\n	on t1.text=t2.text\r\norder by t1.salary_start,t1.salary_end', NULL),
